import "./App.css";
import { useState, useEffect } from "react";
import New from "./components/New";

const INITIAL_FORM = {
  query: "Talento Humano",
  language: "es",
  pageSize: 1,
};

function App() {
  const [data, setData] = useState([]);
  const [form, setForm] = useState(INITIAL_FORM);

  useEffect(() => {
    const getData = async () => {
      const data = await fetch("http://localhost:8080/news");
      setData(await data.json());
    };
    getData();
  });

  const OnSubmit = async (e) => {
    e.preventDefault();

    console.log(form);
    await fetch("http://localhost:8080/news/generate", {
      headers: {
        "Content-Type": "application/json",
      },
      method: "POST",
      body: JSON.stringify(form),
    });

    setForm(INITIAL_FORM);
  };

  const handleChange = (e) => {
    console.log(form);
    const { value, name } = e.target;
    setForm({ ...form, [name]: value });
  };

  return (
    <>
      <div className="form-container">
        <form onSubmit={OnSubmit}>
          <label htmlFor="language">Idioma * </label>
          <select
            name="language"
            id="language"
            onChange={handleChange}
            value={form.language}
          >
            <option value="es">Espa√±ol</option>
            <option value="en">Ingles</option>
          </select>

          <label htmlFor="query">
            Indica sobre que noticias quieres buscar *
          </label>
          <select
            name="query"
            id="query"
            onChange={handleChange}
            value={form.query}
          >
            <option value="Talento Humano">Talento Humano</option>
            <option value="Comunicaci√≥n y marca">Comunicaci√≥n y marca</option>
            <option value="Canales de distribuci√≥n">
              Canales de distribuci√≥n
            </option>
            <option value="Autonom√≠a">Autonom√≠a</option>
            <option value="Consumidor">Consumidor</option>
            <option value="Competitividad">Competitividad</option>
            <option
              value={form.language === "es" ? "Tecnolog√≠a" : "Technology"}
            >
              Tecnolog√≠a
            </option>
            <option value="Sector energ√≠a">Sector energ√≠a</option>
            <option value="Sector retail">Sector retail</option>
            <option value="Gesti√≥n financiera">Gesti√≥n financiera</option>
            <option value="Trabajo aut√≥nomo">Trabajo aut√≥nomo</option>
            <option value="Movilidad">Movilidad</option>
            <option value="Responsabilidad social">
              Responsabilidad social
            </option>
            <option value="Segmento alta renta">Segmento alta renta</option>
            <option value="Habitat">Habitat</option>
            <option value="Regulaci√≥n">Regulaci√≥n</option>
            <option value="Sectores economicos">Sectores economicos</option>
            <option value="Megatendecias">Megatendecias</option>
            <option value="Sector Log√≠stica">Sector Log√≠stica</option>
            <option value="Salud">Salud</option>
            <option value="Urbanizaci√≥n">Urbanizaci√≥n</option>
            <option value="Escasez de recursos">Escasez de recursos</option>
            <option value="Macroeconom√≠a">Macroeconom√≠a</option>
            <option value="Modelos de alianzas">Modelos de alianzas</option>
            <option value="Inmobiliario">Inmobiliario</option>
            <option value="Nutrici√≥n y alimentaci√≥n">
              Nutrici√≥n y alimentaci√≥n
            </option>
            <option value="Conectividad">Conectividad</option>
            <option value="Coronavirus">Coronavirus</option>
            <option value="Agr√≠cola">Agr√≠cola</option>
            <option value="Mercado LATAM">Mercado LATAM</option>
            <option value="Sistemas de informaci√≥n geogr√°fica">
              Sistemas de informaci√≥n geogr√°fica
            </option>
            <option value="L√≠mites Planetarios">L√≠mites Planetarios</option>
            <option value="Demandas cuidadanas">Demandas cuidadanas</option>
            <option value="Anal√≠tica">Anal√≠tica</option>
            <option value="Auditor√≠a Interna">Auditor√≠a Interna</option>
            <option value="Transformaci√≥n digital">
              Transformaci√≥n digital
            </option>
            <option value="Construcci√≥n">Construcci√≥n</option>
            <option value="Clase media">Clase media</option>
            <option value="Cambios demogr√°ficos">Cambios demogr√°ficos</option>
            <option value="Educaci√≥n">Educaci√≥n</option>
            <option value="Ciberseguridad">Ciberseguridad</option>
          </select>

          <label htmlFor="pageSize">
            Numero de noticias que quieres generar
          </label>
          <input
            type="number"
            id="pageSize"
            name="pageSize"
            placeholder="Page Size"
            max={10}
            min={1}
            value={form.pageSize}
            onChange={handleChange}
          />
          <button type="submit"  
  >Generar</button>
        </form>
      </div>
      <div className="App">
        {data.map((a) => (
          <New notice={a} key={a.id} />
        ))}
      </div>
    </>
  );
}

export default App;
